import React from "react";
import Header from './Header';
import Welcome from './Welcome';
import Deals from './Deals';
import Services from './Services';

import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
    return (
    <div>
        <Header/>
        <Welcome/>
        <Services/>
    </div>
    );
}

export default App;
